import React from 'react';
import Styled from 'styled-components';

const ContainerSelected = Styled.div`
  background: blue;
  height: 20px;
`;

const TextSelected = Styled.span`
  font-size: 10px;
  color: #c8c8c8;
`;

const DaySelected = () => {
  return (
    <ContainerSelected>
      <TextSelected>
        <strong>Meeting</strong>, 10:30 am
      </TextSelected>
    </ContainerSelected>
  )
}

export default DaySelected;
